import React, {useState} from 'react';
import { RootTabScreenProps } from '../types';
import { containerStyles } from '../styles/element/containerStyle';
import { ScrollView } from 'react-native-gesture-handler';
import GradientBack from '../components/linegradient/linegradent';
import {Text,View,Pressable } from 'react-native';
import { FontAwesome5,MaterialCommunityIcons,Entypo,Fontisto,MaterialIcons,FontAwesome} from '@expo/vector-icons';
import { storagePageStyles } from '../styles/screenStyles/storageStyle';


export default function UsersScreen({ navigation }: RootTabScreenProps<'UsersScreen'>) {

    const onArrive = () =>{
        navigation.navigate("OrderInScreen");
    }

    const onInstore = () =>{
        navigation.navigate("PhoneHereScreen");
    }

    const onSent = () =>{
        navigation.navigate("OrderOutScreen");
    }

    return(
        <View style={containerStyles.container}>
        <GradientBack/>
        <ScrollView showsHorizontalScrollIndicator={false}>
            <Pressable style={storagePageStyles.button} onPress={onArrive}>
                <Fontisto name="truck"style={storagePageStyles.icon} />
                <Text style={storagePageStyles.text}>Beérkező</Text>
            </Pressable>

            <Pressable style={storagePageStyles.button} onPress={onInstore}>
                <FontAwesome name="inbox" style={storagePageStyles.icon} />
                <Text style={storagePageStyles.text}>Raktáron</Text>
            </Pressable>

            <Pressable style={storagePageStyles.button} onPress={onSent}>
                <FontAwesome name="inbox" style={storagePageStyles.icon} />
                <Text style={storagePageStyles.text}>Kimenő</Text>
            </Pressable>

        </ScrollView>
        </View>
    )
}
